task.summary:
Started work on a simplified version of cocu with a single built-in open message protocol.

Something ala:

var myObj = #{
    var envelope = receive // an envelope contains a sender and message related info (selector and arguments)
    var selector = envelopeSelector: envelope
    var sender = envelopeSender: envelope // sender is basically a continuation at "var res = myObj.doStuff"

    match: self
        Case: "doStuff" Then: reply: sender, "There" // reply "continues" at send-site with the supplied argument
}

var res = myObj.doStuff
// res should now refer to the string "There"

